// import logo from './logo.svg';
import './App.css';
import { BrowserRouter as Router, Switch, Route } from 'react-router-dom'
import { Home } from './views/Home'
import { Listar } from './views/Cliente/Listar'; //http://localhost:3000/listar-clientes
import { Criar } from './views/Cliente/Criar'; //http://localhost:3000/cadastrar-clientes
import { Atualizar } from './views/Cliente/Editar'; //http://localhost:3000/atualizar-clientes
import { Excluir } from './views/Cliente/Excluir'; //http://localhost:3000/excluir-clientes
import { Menu } from './Components/Menu'
import { ListarServico } from './views/Servico/Listar';
import { Item } from './views/Servico/Listar/Item';
import { CadastrarServicos } from './views/Servico/Criar';

function App() {
  return (
    <div className="App">
      <Router>
        <Menu/>
        <Switch>
          <Route exact path="/" component={Home}/>
          <Route path='/listar-clientes' component={Listar}/> 
          <Route path='/cadastrar-clientes' component={Criar}/> 
          <Route path='/atualizar-clientes' component={Atualizar}/>
          <Route path='/excluir-clientes' component={Excluir}/>
          <Route path='/listar-servicos' component={ListarServico}/>
          <Route path='/listarservicos/:id' component={Item}/>
          <Route path='/cadastrarservicos' component={CadastrarServicos}/>
        </Switch>
      </Router>
    </div>
  );
}

export default App;
